class Solution:

    def allUnique(self, s, start, end):
        dic = {}
        for i in range(start, end):
            if s[i] in dic.keys():
                return False
            dic[s[i]] = i
        return True

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if not s:
            return 0
        result = 0
        for i in range(len(s)):
            for j in range(i + 1, len(s) + 1):
                if self.allUnique(s, i, j):
                    result = max(result, j - i)
                else:
                    break
        return result


